import React, { useState } from "react";
import { Link } from "react-router-dom";
import "../styles/Navbar.css"; // اسم ملف CSS الجديد والمخصص

const Navbar = ({ user }) => {
  const [searchQuery, setSearchQuery] = useState("");

  const handleSearchChange = (e) => setSearchQuery(e.target.value);
  const handleSearchSubmit = (e) => {
    e.preventDefault();
    if (searchQuery) console.log("Searching for:", searchQuery);
  };

  return (
    <nav className="rm-navbar">
      <div className="rm-navbar-container">
        <div className="rm-navbar-logo">
          <Link to="/">RentMate</Link>
        </div>

        <form className="rm-search-form" onSubmit={handleSearchSubmit}>
          <input
            type="text"
            placeholder="Search properties..."
            value={searchQuery}
            onChange={handleSearchChange}
            className="rm-search-input"
          />
          <button type="submit" className="rm-search-btn">Search</button>
        </form>

        <ul className="rm-nav-links">
          {user ? (
            <>
              {user.role === "admin" ? (
                <>
                  <li><Link to="/registration-requests">Registration Requests</Link></li>
                  <li><Link to="/post-requests">Post Approval Requests</Link></li>
                </>
              ) : user.role === "landlord" ? (
                <>
                  <li><Link to="/">Home</Link></li>
                  <li><Link to="/properties">Properties</Link></li>
                  <li><Link to="/new-property">Upload New Property</Link></li>
                  <li><Link to="/favorites">Favorites</Link></li>
                  <li><Link to="/profile">My Profile</Link></li>
                  <li><Link to="/contact">Contact Us</Link></li>
                </>
              ) : (
                <>
                  <li><Link to="/">Home</Link></li>
                  <li><Link to="/properties">Properties</Link></li>
                  <li><Link to="/favorites">Favorites</Link></li>
                  <li><Link to="/profile">My Profile</Link></li>
                  <li><Link to="/contact">Contact Us</Link></li>
                </>
              )}
              <li><button className="rm-logout-btn">Logout</button></li>
            </>
          ) : (
            <>
              <li><Link to="/">Home</Link></li>
              <li><Link to="/login">Login</Link></li>
            </>
          )}
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
